    return (

        <MagnifyingGlass
            visible={true}
            height="80"
            width="80"
            ariaLabel="MagnifyingGlass-loading"
            wrapperStyle={{}}
            wrapperClass="MagnifyingGlass-wrapper"
            glassColor='#c0efff'
            color='#e15b64'
        />
    )
}
const Container = styled.div`
width:100%;
height:120vh;
display:flex;
justify-content:center;
align-items:center;
`
